import React from "react"

const toDoList = ({toDo, setToDo}) => {

  return (
  <div>
   {toDo.map((todo) => (
    <li className="todo-List" key={todo.id}>
        <input 
        type="text"
        value={todo.title}
        
        />
    </li>
   ))}


  </div>

  )

}

export default toDoList
